import React from "react";
import One from "./One";
import Two from "./Two";

const Merge = () => {
  return (
    <div className="flex flex-col p-4 m-4 bg-green-300  w-full">
      <div className="">
        <One />
      </div>
      <div className="">
        <Two />
      </div>
    </div>
  );
};
export default Merge;
